import React from "react";
import { logo } from "../assets/images";
import { Link } from "react-router-dom";
import { KeyboardArrowDownRoundedIcon } from "../assets/icons";

const Header = () => {
  return (
    <header className="w-full bg-green-100 px-4 py-4 flex items-center justify-between">
      <Link to={"/"}>
        <img src={logo} alt="" className="w-24 object-cover" />
      </Link>
      <div className="w-[40%] flex bg-white p-2">
        <div className="w-8">
          <div className="flex ">
            <span>All</span>
            <KeyboardArrowDownRoundedIcon />
          </div>
          <ul className="absolute bg-white p-2 max-w-60">
            <li>Amazon Pharmacy</li>
            <li>Amazon Pharmacy</li>
            <li>Amazon Pharmacy</li>
            <li>Amazon Pharmacy</li>
            <li>Amazon Pharmacy</li>
          </ul>
        </div>

        <input type="text" className="block w-full" />
        <span></span>
      </div>
      <nav>
        <Link to={"/"}></Link>
      </nav>
    </header>
  );
};

export default Header;
